    numbers = list(sequence)
    zeros = [num for num in numbers if num == '0']
    non_zeros = [num for num in numbers if num != '0']
    return ''.join(zeros + non_zeros)

def transform(sequence):
    zero_indices = [i for i in range(len(sequence)) if sequence[i] == '0']
    non_zero_indices = [i for i in range(len(sequence)) if sequence[i] != '0']
    transformed = ['0' for _ in range(len(zero_indices))] + [sequence[i] for i in non_zero_indices]
    return ''.join(transformed)
